            {hotels.map(hotel => <HotelItem key ={hotel.id} name = {hotel.name} image_url={hotel.image_url} description={hotel.description} location={hotel.location} prices={hotel.prices} byName={byName}/>)}
            <AddHotel addHotel={addHotel}/>
        </div>
    )
}

